import React from 'react';
import s from "./Navbar.module.css";

const Navbar = () => {
    return (
        <nav className={s.nav}>
            <div className={`${s.item} ${s.active}`}><Nav href="/profile">Profile</Nav></div>
            <div className={s.item}><Nav href="/messages">Messages</Nav></div>
            <div className={s.item}><Nav href="/news">News</Nav></div>
            <div className={s.item}><Nav href="/musics">Music</Nav></div>
            <div className={s.item}><Nav href="/settings">Settings</Nav></div>
        </nav>
    );
}

export default Navbar;
